import React from 'react';
import { Card, CardContent } from '@/components/ui/card';

const BenefitCard = ({ emoji, title, description }) => (
  <Card className="transition-all duration-300 hover:shadow-lg">
    <CardContent className="p-6 flex flex-col items-center text-center">
      <div className="mb-4 p-3 rounded-full bg-orange-100">
        <span className="text-2xl" role="img" aria-label={title}>
          {emoji}
        </span>
      </div>
      <h3 className="text-lg font-semibold mb-2 text-[#432910]">{title}</h3>
      <p className="text-gray-600">{description}</p>
    </CardContent>
  </Card>
);

const KilnDriedBenefits = () => {
  const benefits = [
    {
      emoji: "üî•",
      title: "Easy to Ignite",
      description: "Quick and effortless lighting for immediate warmth and comfort"
    },
    {
      emoji: "üåø",
      title: "Eco-Friendly",
      description: "Lower emissions due to efficient burning and reduced moisture content"
    },
    {
      emoji: "üå°Ô∏è",
      title: "Higher Heat Output",
      description: "Maximum heat efficiency due to minimal moisture content"
    },
    {
      emoji: "üíß",
      title: "Low Moisture",
      description: "Less than 20% moisture content for cleaner, more efficient burning"
    }
  ];

  return (
    <div className="w-full py-12 px-4">
      <div className="max-w-6xl mx-auto">
        <h2 className="text-3xl font-bold text-center mb-12 text-[#432910]">
          Why Kiln Dried Logs?
        </h2>
        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-4 gap-6">
          {benefits.map((benefit, index) => (
            <BenefitCard key={index} {...benefit} />
          ))}
        </div>
      </div>
    </div>
  );
};

export default KilnDriedBenefits;
